import React from "react";
import { useLocation } from "react-router-dom";

function PageError() {
  const location = useLocation();

  return (

    <div>
      {location.state === undefined ? (
        <p>No errors !</p>
      ) : (
        <p>{location.state.details}</p>
      )}
    </div>
  );
}

export default PageError;
